import React from "react";
import "./style.css";

function Nav() {
  return (
    <nav className="navbar navbar-expand-lg navbar-dark bg-primary" style={{margin: 0}}>
      <a className="navbar-brand" href="/">
        Google Book Search
      </a>
    </nav>
  );
}

export default Nav;
